import React from 'react'
import Navbar from '../pages/LandingPage'


class PageTwo extends React.Component {
    state = {
        id: data.id,
        species: data.species,
        breed: data.breed,
        age: data.age,
        gender: data.gender,
        spayed_neutered: data.spayed_neutered,
        house_trained: data.house_trained,
        name: data.name,
        email: data.email,
        phone: data.phone,
        street_address: data.street_address,
        city: data.city,
        state: data.state,
        zip_code: data.zip_code,
        photos: data.photos[0]

    }

    componentDidMount() {
        fetch('/api/animals')
            .then(response => response.json())
            .then(data => this.setState({ animals: data }))
    }
    render() {
        let dogs = this.state.animals.filter(animal => {
            return animal.species === 'Dog' && animal.photo
        })
        console.log(dogs)
        let animals = dogs.map((animals, key) =>
            <div key={animals.name}>
                <img src={animals.photo} alt="dogs" />
                {animals.name}
            </div>
        )

        return (
            <div className="pets">
                {this.animals}
            </div >
        )
    }
}
export default PageTwo
